import Head from "../components/head";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Row, Col } from "react-bootstrap";
const Index = () => (
  <html>
    <head />
    <body>
      <Container fluid={true} className="h100">
        <Container className="h100">
          <Row className="align-items-center h100">
            <Col lg={6}>
              <p className="pHello">Hello!</p>
              <p className="pHelloSub">
                Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
                eiusmod tempor incididunt ut labore et dolore magna aliqua.{" "}
              </p>
             <p className="pEmail">Email Address</p>
             <button className = "btnEmail">Enter email address here..</button>
            </Col>
            <Col lg={6}>

            </Col>
          </Row>
        </Container>
      </Container>
      <style jsx>{`
        body,
        html {
          height: 100%;
          width: 100%;
        }
        .pHello {
          font-family: roboto, sans-serif;
          color: #212121;
          font-size: 2.5rem;
          font-weight: bold;
        }
        .pHelloSub {
          font-family: roboto, sans-serif;
          color: #9e9e9e;
          font-family: 1rem;
          margin-top: -10px;
        }
        .divcontainer-fluid , .divcontainer{
          height: 100vh;
        }
        .rowh100 {
          height: 100vh;
          background-color: blue;
        }
        .pEmail {
          font-family: roboto, sans-serif;
          color: #9e9e9e;
          font-size: 0.9rem;
        }
        .btnEmail {
          font-family: roboto, sans-serif;
          color: #424242;
          border: 1px solid #E0E0E0;
          background-color: #FAFAFA;
          border-radius: 10px;
          padding: 10px 20px;
          font-siz: 0.9rem;
          width: 300px;
          text-align:left;
        }
      `}</style>
    </body>
  </html>
);

export default Index;
